import React from 'react'
import './contact.css'


const Contact = () => {
  return (
    <section className="contact section" id="contact">
         <h2 className="section-title">Get in touch</h2>
        <span className="section-subtitle">
            Projects Don
        </span>
    </section>
  )
}

export default Contact
